import axios from 'axios'

export function UserSignUp(data) {
    return new Promise((resolve, reject) => {
        axios.post('/user/signup', data)
        .then((response) => {
            resolve(response.data)
        })
        .catch((error) => {
            reject(error)
        })
    })
}
